window.bookSummaryJSON = "<p><b>What happens in Cedarwood cabin stays in Cedarwood cabin.</b></p> <p>After her mother's tragic death, Flora Lockley leaves England and moves with her father to a small forest town in America.</p> <p>Flora's life takes a dramatic turn when dark thoughts torment her mind. Waking up in an isolated cabin deep in the forest, she is confronted by the two local biker brothers, Dax and Lyka Faulkner. Flora questions everything as she struggles with this unexpected situation.</p> <p><i>For mature listeners.</i></p>"; 
